function wifiDBFromQuality(quality) {
  const qual = parseFloat(quality);
  if (qual < 0) { return 0; }
  if (qual >= 100) { return -50; }
  return (qual / 2 - 100);
}

function wifiQualityFromDB(db) {
  const result = 2 * (parseFloat(db) + 100);
  return result <= 100 ? result : 100;
}

